function initialize(){$(".message .close").on("click",function(){$(this).closest(".message").transition("fade")});$(".ui.sidebar").sidebar({dimPage:!1,onVisible:function(){$("#toggle-sidebar-link").addClass("active")},onHide:function(){$("#toggle-sidebar-link").removeClass("active")}}).sidebar("attach events","#toggle-sidebar-link");$(".ui.checkbox").checkbox();$(".ui.dropdown").dropdown();$("select.dropdown").dropdown();$(".dropdown[data-setting]").each(function(n,t){var i=$(t).data("setting");$(t).dropdown(JSON5.parse(i))})}String.format||(String.format=function(n){var t=Array.prototype.slice.call(arguments,1);return n.replace(/{(\d+)}/g,function(n,i){return typeof t[i]!="undefined"?t[i]:n})});$(initialize);